import React, { useState } from "react";
import { Link, Outlet, Route, Routes } from "react-router-dom";
import { useHistory } from "react-router-dom";

function BonsaiCollection({ bonsais }) {
  const history = useHistory();

  function handleBonsaiClick(id) {
    history.push(`/bonsaicollection/${id}`);
  }
  return (
    <div>
      <h2>Click on a bonsai for more details</h2>
      <ul>
        {bonsais.map((bonsai) => (
          <li key={bonsai.id}>
            <Link to={`/bonsaicollection/${bonsai.id}`} onCl >{bonsai.name}</Link>
          </li>
        ))}
      </ul>
      <Outlet />
    </div>
  );
}

export default BonsaiCollection;
